  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:10.598886\",\n\t\"name\": \"reelfoot-lake-isom-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Reelfoot and Lake Isom NWRs for the next 15 years.
  This plan outlines the refuges' vision and purpose and describes how Reelfoot and
  Lake Isom NWRs will contribute to the overall mission of the Refuge System. The
  plan provides an introduction to the refuges, an overview of the CCP process, information
  about the management direction, and strategies for implementation. Key planning
  issues include: fish and wildlife population management, habitat management, resource
  protection, visitor services, Refuge administration, and land protection.\",\n\t\"license_title\":
